import React, {Fragment} from 'react';
import Header from "../../components/Helpers/Header/Header";
import {Grid} from "@material-ui/core";
import DashboardDrawer from "../../components/DashboardDrawer/DashboardDrawer";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import AdminSection from "../AdminSection/AdminSection";
import AnnouncementList from "../../components/Announcements/AnnouncementList";
import StudentProfile from "../../components/StudentProfile/StudentProfile";

const Dashboard = props => {
    return (
        <Fragment>
          <Header />
          <Grid container spacing={2}>
            <Grid item xs={1} style={{ marginLeft: -8 }}>
              <DashboardDrawer />
            </Grid>
            <Grid item xs={11}>
              <AdminSection />
              <BrowserRouter>
                <Switch>
                  <Route path={"/dashboard/announcements"} render={props => <AnnouncementList { ...props } />} exact />
                  <Route path={"/dashboard/profile"} render={props => <StudentProfile { ...props } />} exact />
                  {/*<Route path={"/dashboard/studentMarks/:action"} render={props => <AddStudentMarksSection { ...props } />} />*/}
                </Switch>
              </BrowserRouter>
            </Grid>
          </Grid>
        </Fragment>
    )
}

export default Dashboard;
